import { Text,StyleSheet, View,Image,ImageBackground } from 'react-native';
import Icons from './Icons';
import  Search from './Search'

const Entete =props => {
  
        return (     

<ImageBackground source={require('../assets/Arriere.png')} style={styles.backgroundStyle} >
           <Text style={styles.itemText1}> Bienvenue Ahmed</Text>
           <Search/>
          
           <Text style={styles.itemText2}>Lundi 12 Mars 2021</Text>    
        <Icons/>
</ImageBackground>
        );
      };
    
    // create style to component
    const styles = StyleSheet.create({
      backgroundStyle: {
        flex: 1,
        width: null,
        height: null,
        resizeMode: 'cover',
       
      },

      itemText1: {
        color: '#FFFFFF',
        marginTop: 20,
        marginLeft: 40,
        fontSize:20
      },
      itemText2: {
        color: '#FFFFFF',
        marginLeft: 200,
        fontSize:10,
        borderRadius: 50,
      },
     
      });
    //Export to component so we can use it elsewhere in our project
    export default  Entete ;
